import { BrowserRouter as Router,Link } from "react-router-dom";
import "./Home.css"
import logo from "./img/logo.png"
class PageHeader extends Component {
  render() {
    return (
      <div>
        <div className = 'icon-container'>
        <Image src={logo} fluid className='imagecover'/>
          <h1 className='title'> <Link to="/" className="link">honestly.
    </Link>
          <div className='icons'>
          <Link to="/" className='link'>
            <i className="fa fa-home" id='home'></i>
          </Link>
          <Link to="/Level" className='link'>
            <i className="fa fa-magnet" id = 'game'></i>
          </Link>
          <Link to="/Team" className='link'>
            <i className="fa fa-users" id = 'team'></i>
          </Link>
          </div>
          </h1>
          </div>
      </div>
    );
  }
}
export default PageHeader;
